import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import { ThemeProvider, createTheme } from '@mui/material/styles';
import { CssBaseline } from '@mui/material';
import { SnackbarProvider } from 'notistack';

// Contexts
import { AuthProvider } from './contexts/AuthContext';

// Components
import { ProtectedRoute } from './components/common/ProtectedRoute';
import { Layout } from './components/common/Layout';

// Pages
import { Login } from './pages/Login';
import { Dashboard } from './pages/Dashboard';
import { Agenda } from './pages/medico/Agenda';
import { HistoricoPaciente } from './pages/paciente/HistoricoPaciente';
import { GerenciarFuncionarios } from './pages/admin/GerenciarFuncionarios';

const theme = createTheme({
  palette: {
    primary: {
      main: '#1976d2',
    },
    secondary: {
      main: '#dc004e',
    },
  },
  typography: {
    fontFamily: 'Roboto, Arial, sans-serif',
  },
});

function App() {
  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <SnackbarProvider maxSnack={3}>
        <AuthProvider>
          <Router>
            <Routes>
              {/* Rota pública */}
              <Route path="/login" element={<Login />} />

              {/* Rotas protegidas */}
              <Route
                path="/dashboard"
                element={
                  <ProtectedRoute>
                    <Layout>
                      <Dashboard />
                    </Layout>
                  </ProtectedRoute>
                }
              />

              {/* Rotas específicas para médicos */}
              <Route
                path="/agenda"
                element={
                  <ProtectedRoute allowedRoles={['medico']}>
                    <Layout>
                      <Agenda />
                    </Layout>
                  </ProtectedRoute>
                }
              />

              {/* Rotas específicas para administradores */}
              <Route
                path="/funcionarios"
                element={
                  <ProtectedRoute allowedRoles={['administrador']}>
                    <Layout>
                      <GerenciarFuncionarios />
                    </Layout>
                  </ProtectedRoute>
                }
              />

              {/* Rotas acessíveis por múltiplos tipos de usuário */}
              <Route
                path="/pacientes/:id/historico"
                element={
                  <ProtectedRoute allowedRoles={['medico', 'enfermeiro', 'atendente']}>
                    <Layout>
                      <HistoricoPaciente />
                    </Layout>
                  </ProtectedRoute>
                }
              />

              {/* Placeholder para outras rotas */}
              <Route
                path="/pacientes"
                element={
                  <ProtectedRoute>
                    <Layout>
                      <div>Página de Pacientes (em desenvolvimento)</div>
                    </Layout>
                  </ProtectedRoute>
                }
              />

              <Route
                path="/consultas"
                element={
                  <ProtectedRoute allowedRoles={['medico']}>
                    <Layout>
                      <div>Página de Consultas (em desenvolvimento)</div>
                    </Layout>
                  </ProtectedRoute>
                }
              />

              <Route
                path="/triagem"
                element={
                  <ProtectedRoute allowedRoles={['enfermeiro']}>
                    <Layout>
                      <div>Página de Triagem (em desenvolvimento)</div>
                    </Layout>
                  </ProtectedRoute>
                }
              />

              <Route
                path="/exames"
                element={
                  <ProtectedRoute allowedRoles={['enfermeiro']}>
                    <Layout>
                      <div>Página de Exames (em desenvolvimento)</div>
                    </Layout>
                  </ProtectedRoute>
                }
              />

              <Route
                path="/agendamentos"
                element={
                  <ProtectedRoute allowedRoles={['atendente']}>
                    <Layout>
                      <div>Página de Agendamentos (em desenvolvimento)</div>
                    </Layout>
                  </ProtectedRoute>
                }
              />

              <Route
                path="/relatorios"
                element={
                  <ProtectedRoute allowedRoles={['administrador']}>
                    <Layout>
                      <div>Página de Relatórios (em desenvolvimento)</div>
                    </Layout>
                  </ProtectedRoute>
                }
              />

              <Route
                path="/configuracoes"
                element={
                  <ProtectedRoute allowedRoles={['administrador']}>
                    <Layout>
                      <div>Página de Configurações (em desenvolvimento)</div>
                    </Layout>
                  </ProtectedRoute>
                }
              />

              {/* Rota de acesso negado */}
              <Route
                path="/unauthorized"
                element={
                  <Layout>
                    <div style={{ textAlign: 'center', padding: '2rem' }}>
                      <h2>Acesso Negado</h2>
                      <p>Você não tem permissão para acessar esta página.</p>
                    </div>
                  </Layout>
                }
              />

              {/* Redirecionamento padrão */}
              <Route path="/" element={<Navigate to="/dashboard" replace />} />
              <Route path="*" element={<Navigate to="/dashboard" replace />} />
            </Routes>
          </Router>
        </AuthProvider>
      </SnackbarProvider>
    </ThemeProvider>
  );
}

export default App;
